import React, {Component} from 'react';
import {View,Text,StyleSheet,TextInput,TouchableOpacity} from 'react-native';

class Register extends Component {
    state = {}
    render() {
        return (
            <View style= {styles.container}>
                <Text style = {styles.textRegister}>UserID</Text>
                <TextInput
                    style={styles.textInput}
                    placeholder='Username'
                    autoCapitalize="none"
                    placeholderTextColor="#666666"
                    //onChangeText={val => this.onChangeText('username', val)}
                />
                
                <Text style = {[styles.textRegister,{marginTop:35}]}>Password</Text>
                <TextInput
                    style={styles.textInput}
                    placeholder='Password'
                    secureTextEntry={true}
                    autoCapitalize="none"
                    placeholderTextColor="#666666"
                    //onChangeText={val => this.onChangeText('password', val)}
                />

                <Text style = {[styles.textRegister,{marginTop:35}]}>E-mail</Text>
                <TextInput
                    style={styles.textInput}
                    placeholder='Email'
                    autoCapitalize="none"
                    placeholderTextColor="#666666"
                    //onChangeText={val => this.onChangeText('email', val)}
                />
                
                <View style={styles.button}>
                    <TouchableOpacity style={styles.appButtonContainer}>
                        <Text style={styles.appButtonText}>Registrati</Text>
                    </TouchableOpacity>
                </View>

            </View>
        );
    }
}

export default Register;


const styles = StyleSheet.create({
    container: {
        flex: 3,
        backgroundColor: '#fff',
        borderTopLeftRadius: 30,
        borderTopRightRadius: 30,
        paddingHorizontal: 20,
        paddingVertical: 30
    },
    textInput: {
        flex: 1,
        marginTop: 4,
        paddingLeft: 15,
        color: '#05375a',
    },
    textRegister: {
        color: '#05375a',
        fontSize: 18,
        fontWeight: "bold"
    },
    button: {
        alignItems: 'center',
        marginTop: 50
    },
    appButtonContainer: {
        elevation: 8,
        backgroundColor: "#009688",
        borderRadius: 10,
        paddingVertical: 10,
        paddingHorizontal: 12
      },
      appButtonText: {
        fontSize: 18,
        color: "#fff",
        fontWeight: "bold",
        alignSelf: "center",
        textTransform: "uppercase"
      }
});
